/*
Given an array nums[] of size N having distinct elements, the task is to find the next greater element for each element of the array
Next greater element of an element in the array is the nearest element on the right which is greater than the current element.
If there does not exist a next greater of a element, the next greater element for it is -1

Note: iostream, stack and vector are already included

Constraints:
1 <= nums.length <= 10^5
0 <= nums[i] <= 10^9

Example 1:
Input:
nums = {15, 2, 4, 10}
Output:
{-1, 4, 10, -1}

Example 2:
Input:
nums = {1, 4, 6, 9, 6}
Output:
{4, 6, 9, -1, -1}

*/

#include<iostream>
#include<stack>
#include<vector>
using namespace std;

vector<int> nextGreaterElement(vector<int>& arr) {
    int n = arr.size();
    stack<int> st;
    vector<int> result(n, -1);
    for(int i = n - 1; i >= 0; i--){
        while(!st.empty() && arr[i] > st.top()){
            st.pop();
        }
        if(!st.empty()){
            result[i] = st.top();
        }
        st.push(arr[i]);
    }
    return result;
}

vector<int> nextGreater(vector<int>& arr){
    stack<int> s;
    vector<int> result(arr.size(), -1);
    for (int i = 0; i < arr.size(); i++) {
        while (!s.empty() && arr[i] > arr[s.top()]) {
            int idx = s.top();
            result[idx] = arr[i];
            s.pop();
        }
        s.push(i);
    }
    return result;
}


int main() {
    vector<int> nums = {15, 2, 1, 10}; // -1 10 10 -1 
    vector<int> result = nextGreaterElement(nums);
    for (int i = 0; i < result.size(); i++) {
        cout << result[i] << " ";
    }
    cout << endl;
    nums = {1, 4, 6, 9, 6};
    result = nextGreaterElement(nums);
    for (int i = 0; i < result.size(); i++) {
        cout << result[i] << " ";
    }
    cout << endl;
    return 0;
}


